syntax = "proto3";
option java_package = "pb";
option java_outer_classname="smn_dict";
option go_package = "github.com/ProtossGenius/hacknet/pb/smn_dict;smn_dict";
package smn_dict;

enum EDict{
	None = 0;
	hnp_Register = 2;
	hnp_Result = 5;
	hnp_CheckEmail = 7;
	hmsg_Message = 9;
	hnp_Forward = 10;
	//hnp_to the point. = 14;
	hnp_SendMsg = 15;
	hnp_HeartJump = 16;
}
